import React from "react";

const MenuList = ({ action = "add", menuItems }) => {
  return (
    <div className="flex flex-col gap-2 w-full">
      <h2 className="text-2xl text-slate-800">Menu List</h2>

      {menuItems.map((i) => (
        <div className="w-full border border-slate-200 shadow-md"></div>
      ))}
    </div>
  );
};

export default MenuList;
